import axios from "axios"

const API_KEY = "1b1e23fe038806fdee0e87a95ede63fc"
const URL = "https://api.openweathermap.org/data/2.5/weather"


export const get = async (query) => {
    let { data } = await axios.get(URL, {
        params: {
            q: "query",
            units: "metric",
            APPID: "API_KEY"

        }
    })
    return data

}
